import React, { useState, useEffect } from 'react';
import axios from 'axios'; // Ensure axios is imported
import { Typography, Button, Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

const CSB02 = () => {
    const [projectDetails, setProjectDetails] = useState({
        Project: '',
        student1: '',
        student2: '',
        teacher: ''
    });
    const [PData, setPData] = useState({
        P_name: '',
        P_details: '',
        P_status: '',
        P_CSB01: '',
        P_CSB02: '',
        P_CSB03: '',
        P_S1: '',
        P_S2: '',
        P_T: ''
    });
    const handleRejectClick = async () => {
        try {
            await axios.post('http://localhost:9999/Project', {
                ...projectDetails,
                status: 'Rejected'
            });
            alert('การยื่นโครงงานถูกปฏิเสธ');
        } catch (error) {
            console.error('Error rejecting project:', error);
            alert('ไม่สามารถปฏิเสธโครงงานได้');
        }
    };

    const handleAcceptClick = async () => {
        try {
            await axios.post('http://localhost:9999/Project', {
                ...projectDetails,
                status: 'Accepted'
            });
            alert('การยื่นโครงงานได้รับการอนุมัติ');
        } catch (error) {
            console.error('Error accepting project:', error);
            alert('ไม่สามารถอนุมัติโครงงานได้');
        }
    };

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Project');
                const data = response.data;

                // Assuming the API returns an array of projects and we want the first project
                if (Array.isArray(data) && data.length > 0) {
                    const project = data[0]; // Adjust based on actual API response
                    setProjectDetails({
                        Project: project.projectName || '',
                        student1: project.student1Name || '',
                        student2: project.student2Name || '',
                        teacher: project.teacherName || ''
                    });
                } else {
                    console.error('Unexpected API response:', data);
                }
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <div>
                                <Typography variant="h1">
                                    การยื่นก้าวหน้า โครงงานพิเศษ 1
                                    <Typography variant="subtitle1">
                                        แบบฟอร์มยินยอมสอบก้าวหน้าโครงงานพิเศษ (สองภาษา) <br />
                                        ภาควิชาวิทยาการคอมพิวเตอร์และสารสนเทศ <br />
                                        คณะวิทยาศาสตร์ประยุกต์มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าพระนครเหนือ<br />
                                        ข้าพเจ้ายินยอมสอบก้าวหน้า {projectDetails.Project}<br />
                                        นักศึกษาคนที่ 1: {projectDetails.student1}<br />
                                        นักศึกษาคนที่ 2: {projectDetails.student2}<br />
                                        โดยมีอาจารย์ที่ปรึกษา {projectDetails.teacher}
                                        <Grid container spacing={2}>
                                            <Grid item>
                                                <Button variant="contained" color="error" onClick={handleRejectClick}>
                                                    ปฏิเสธ
                                                </Button>
                                            </Grid>
                                            <Grid item>
                                                <Button variant="contained" color="success" onClick={handleAcceptClick}>
                                                    ยินยอม
                                                </Button>
                                            </Grid>
                                        </Grid>
                                    </Typography>
                                </Typography>
                            </div>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
};

